import React from 'react';
import Logo from '../assets/choiz-logo.svg';

const Footer = () => (
    <footer>
        <img src={Logo}  alt="Choiz" />
        <p>&copy; XCALE HEALTH srl .Todos los derechos reservados.</p>
    </footer>
);

export default Footer;
